import styled from "styled-components/macro";

const Wrapper = styled.div`
  .nav-links {
      font-size: 11px;
  }

  .capco-logo {
    position: absolute;
width: 170px;
height: 60.38px;
left: calc(50% - 170px/2 - 715px);
top: 0px;
  }

  .logo-text, .nav-links {
      font-family: 
      Ubuntu Mono;
  }
`;

export default Wrapper;
